import RestaurantsList from './RestaurantsList';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom'

export class App extends React.Component {
	constructor() {
		super();
		this.state = {
			val1: null,
			val2: null,
			val3: null,
			restaurant: 1,
		};
	}
	render() {
		return (this.servicesForm());
	}
	submit = (key) => {
		/*e.preventDefault();
		console.log("submit2")
		const data = [this.state.val1, this.state.val2, this.state.val3];
