	}
	servicesForm() {
		const restaurants = [{
			name: "Burger King",
			fee: "$0.50",
			miles: 2,
		},
		{
			name: "Taco Bell",
			fee: "$0.80",
			miles: 7,
		},
		{
			name: "Dominos",
			fee: "$0.20",
			miles: 1,
		}];
		return (
		<BrowserRouter>

			<Routes>
				<Route path={"/"} element={<RestaurantsList />} />
				<Route path={"/showMenu"} element={<ShowMenu restaurant={this.state.restaurant} />} />
                <Route path={"/showMenuItem"} element={<ShowMenuItem menuItem={1} />} />
            </Routes>
		</BrowserRouter>
		)
	}
}
export default App;
